"use strict";
/**
 * Функция "getTimingFunc"
 */
function getTimingFunc(easing){switch(easing){
case "linear": return "tF";
case "easeInQuad": return "Math.pow(tF,2)";
case "easeOutQuad": return "1-Math.pow(1-tF,2)";
case "easeInOutQuad": return "(tF<0.5)?(Math.pow(2*tF,2)/2):((2-Math.pow(2*(1-tF),2))/2)";
case "easeInCubic": return "Math.pow(tF, 3)";
case "easeOutCubic": return "1-Math.pow(1-tF,3)";
case "easeInOutCubic": return "(tF<0.5)?(Math.pow(2*tF,3)/2):((2-Math.pow(2*(1-tF),3))/2)";
case "easeInQuint": return "Math.pow(tF,5)";
case "easeOutQuint": return "1-Math.pow(1-tF,5)";
case "easeInOutQuint": return "(tF<0.5)?(Math.pow(2*tF,5)/2):((2-Math.pow(2*(1-tF),5))/2)";
}return "easing(tF)";};